import React, { useState } from 'react';

// Main Panel Component
const AIPanel = ({ data }) => {
  return (
    <div className="altitude-panel py-6 px-20 max-w-3xl w-full mx-auto space-y-4 bg-white rounded-xl shadow-lg">
      {data.objects.map((object, index) => (
        <ObjectPanel key={index} object={object} />
      ))}
    </div>
  );
};

// Object Panel with Collapsible Dropdown
const ObjectPanel = ({ object }) => {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <div className="object-panel bg-gray-100 p-4 rounded-lg shadow-md">
      {/* Object Header */}
      <div
        className="flex justify-between items-center cursor-pointer"
        onClick={() => setIsOpen(!isOpen)}
      >
        <h3 className="text-lg font-bold">{object.name}</h3>
        <button className="text-gray-500">{isOpen ? "▲" : "▼"}</button>
      </div>

      {/* Collapsible Content */}
      {isOpen && (
        <div className="mt-4 space-y-4">
          {object.detections.map((detection, index) => (
            <DetectionDetails key={index} detection={detection} />
          ))}
        </div>
      )}
    </div>
  );
};

// Detection Details Component
const DetectionDetails = ({ detection }) => {
  return (
    <div className="detection-details bg-gray-50 p-4 rounded-lg shadow-inner">
      <p>
        <strong>Timestamp:</strong> {detection.Timestamp}
      </p>
      <p>
        <strong>Long:</strong> {detection.Long}
      </p>
      <p>
        <strong>Lat:</strong> {detection.Lat}
      </p>
      <p>
        <strong>Confidence:</strong> {detection.Confidence}%
      </p>
      <p>
        <strong>ImgNum:</strong> {detection.ImgNum}
      </p>
    </div>
  );
};

export default AIPanel;
